// src/components/BreadcrumbNav.js
import React from 'react';

function BreadcrumbNav() {
  return (
    <nav className="breadcrumb-nav">
      <a href="/#">Trang chủ</a> &gt; 
      <a href="/#">Sản phẩm</a> &gt; 
      <span>Vợt cầu lông</span>
    </nav>
  );
}

export default BreadcrumbNav;
